import React, { useEffect, useState } from "react";
import ForceGraph2D from "react-force-graph-2d";

const ageOptions = {
  0: "0-9",
  1: "10-19",
  2: "20-29",
  3: "30-39",
  4: "40-49",
  5: "50-59",
  6: "60-69",
  7: "70-79",
};

const yearOptions = {
  0: "2003-2004",
  1: "2005-2006",
  2: "2007-2008",
  3: "2009-2010",
  4: "2011-2012",
  5: "2013-2014",
};

const sessoOptions = ["Male", "Female"];
const tipoReteOptions = ["BONF", "FDR"];

function AnalyticsPage() {
  const [tipoRete, setTipoRete] = useState("");
  const [eta, setEta] = useState("");
  const [anno, setAnno] = useState("");
  const [sesso, setSesso] = useState("");
  const [graphData, setGraphData] = useState({ nodes: [], links: [] });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const fetchGraph = () => {
    if (tipoRete && eta !== "" && anno !== "" && sesso) {
      setLoading(true);
      setError("");
      const url = `http://localhost:8000/graph?tipo_rete=${tipoRete}&eta=${eta}&anno=${anno}&sesso=${sesso}`;
      fetch(url)
        .then(res => {
          if (!res.ok) throw new Error("File non trovato o errore server");
          return res.json();
        })
        .then(data => {
          setGraphData({
            nodes: data.nodes,
            links: data.edges,
          });
        })
        .catch(err => {
          console.error(err);
          setError(err.message);
          setGraphData({ nodes: [], links: [] });
        })
        .finally(() => {
          setLoading(false);
        });
    }
  };

  useEffect(() => {
    fetchGraph();
  }, [tipoRete, eta, anno, sesso]);

  return (
    <div style={{ padding: "1rem", height: "100vh", boxSizing: "border-box" }}>
      {/* Selezione filtri */}
      <div style={{ display: "flex", gap: "1rem", marginBottom: "1rem", flexWrap: "wrap" }}>
        <select value={tipoRete} onChange={e => setTipoRete(e.target.value)}>
          <option value="">Tipo Rete</option>
          {tipoReteOptions.map(opt => (
            <option key={opt} value={opt}>{opt}</option>
          ))}
        </select>

        <select value={eta} onChange={e => setEta(e.target.value)}>
          <option value="">Età</option>
          {Object.entries(ageOptions).map(([key, label]) => (
            <option key={key} value={key}>{label}</option>
          ))}
        </select>

        <select value={anno} onChange={e => setAnno(e.target.value)}>
          <option value="">Anno</option>
          {Object.entries(yearOptions).map(([key, label]) => (
            <option key={key} value={key}>{label}</option>
          ))}
        </select>

        <select value={sesso} onChange={e => setSesso(e.target.value)}>
          <option value="">Sesso</option>
          {sessoOptions.map(opt => (
            <option key={opt} value={opt}>{opt}</option>
          ))}
        </select>
      </div>

      {/* Messaggi */}
      {loading && <div>Caricamento grafo...</div>}
      {error && <div style={{ color: "red" }}>{error}</div>}

      {/* Visualizzazione grafo */}
      {!loading && !error && graphData.nodes.length > 0 && (
        <div style={{ height: "85%", width: "100%" }}>
          <ForceGraph2D
            graphData={graphData}
            nodeId="id"
            linkSource="source"
            linkTarget="target"
            nodeLabel="id"
            nodeAutoColorBy="id"
            enableNodeDrag={true}
            nodeRelSize={4}
          />
        </div>
      )}
    </div>
  );
}

export default AnalyticsPage;
